    [],nt"revision_timestamp": "2015-01-21T18:33:49.644301",nt"name": "tiger-line-shapefile-2012-series-information-file-for-the-current-area-hydrography-shapefiles",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation. The Area Hydrography Shapefile contains the geometry and attributes of both
    perennial andn               intermittent area hydrography features, including ponds,
    lakes, oceans, swamps (up to the U.S. nautical three-mile limit), glaciers, and
    the area coveredn               by large rivers, streams, and/or canals that are
    represented as double-line drainage. Single-line drainage water features can be
    found in the Linearn               Hydrography Shapefile (LINEARWATER.shp). Linear
    water features includes single-line drainage water features and artificial path
    features, where theyn               exist, that run through double-line drainage
    features such as rivers, streams, and/or canals, and serve as a linear representation
    of these features.n            ",nt"license_title": null,nt"extras": [{ntt"key":
